INSERT INTO `posts` VALUES
(1,'petition','Petition for Better Road Infrastructure','We need better roads in our community to ensure safety and accessibility.','[\"https:\\/\\/i.imgur.com\\/6OiQwEJ.jpeg\",\"https:\\/\\/i.imgur.com\\/cl7CDK6.jpeg\"]',1,'active','2024-12-12 11:26:18','2024-12-12 11:26:18'),
(2,'petition','Petition for Improved Healthcare Services','Our healthcare system needs urgent reforms to better serve the community.','[\"https:\\/\\/i.imgur.com\\/DI5HhNd.jpeg\",\"https:\\/\\/i.imgur.com\\/SMBmLqX.jpeg\"]',2,'active','2024-12-12 11:26:18','2024-12-12 11:26:18'),
(3,'petition','Petition for Environmental Protection','We urge the government to take action against pollution in our area.','[\"https:\\/\\/i.imgur.com\\/vSltOz5.jpeg\",\"https:\\/\\/i.imgur.com\\/fu2EWSt.png\"]',3,'active','2024-12-12 11:26:18','2024-12-12 11:26:18'),
(4,'eyewitness','Eyewitness Report: Accident on Main Street','I witnessed a serious accident involving two cars at the intersection.','[\"https:\\/\\/i.imgur.com\\/bNSRtUa.jpeg\",\"https:\\/\\/i.imgur.com\\/ZGBLL5r.jpeg\"]',4,'active','2024-12-12 11:26:19','2024-12-12 11:26:19'),
(5,'eyewitness','Eyewitness Report: Theft at Local Market','I saw a theft incident at the local market yesterday afternoon.','[\"https:\\/\\/i.imgur.com\\/cbxyz99.jpeg\",\"https:\\/\\/i.imgur.com\\/U43c4kd.jpeg\"]',5,'active','2024-12-12 11:26:19','2024-12-12 11:26:19'),
(6,'eyewitness','Eyewitness Report: Fire Incident at Warehouse','A fire broke out at the warehouse causing significant damage.','[\"https:\\/\\/i.imgur.com\\/68BVZ0K.jpeg\",\"https:\\/\\/i.imgur.com\\/8OFejgA.jpeg\"]',6,'active','2024-12-12 11:26:19','2024-12-12 11:26:19'),
(13,'eyewitness','Just Saw A Goat On Main Street','<p><strong>A surprising encounter in the heart of the city: a lone goat was spotted casually strolling down Main Street, turning heads and sparking curiosity. Amid the hustle and bustle of urban life, the unexpected visitor brought a moment of wonder and laughter. Where did it come from, and where was it headed? This brief, quirky event reminds us that sometimes, even in the most ordinary places, the extraordinary can appear without warning.</strong></p>','[\"https:\\/\\/res.cloudinary.com\\/dsueaitln\\/image\\/upload\\/v1734011048\\/media\\/uh6ggjed1xa6xun3l1k1.png\"]',2,'active','2024-12-12 13:44:09','2024-12-12 13:44:09'),
(14,'eyewitness','Partying people 24/7','<p>My people, una well done. Let\'s do more</p>','[\"https:\\/\\/res.cloudinary.com\\/dsueaitln\\/image\\/upload\\/v1734014955\\/media\\/y70dsjrbimxsjlg0onny.jpg\"]',114,'active','2024-12-12 14:49:15','2024-12-12 14:49:15'),
(15,'eyewitness','Testing testing testing','<p>If you\'re seeing this, kindly test the user profile section. </p>','[\"https:\\/\\/res.cloudinary.com\\/dsueaitln\\/image\\/upload\\/v1734020160\\/media\\/qoutyghd0wq3glf8oyvh.jpg\"]',114,'active','2024-12-12 16:16:00','2024-12-12 16:16:00'),
(16,'eyewitness','This is a dummy eyewitmess report','<p>fknsjdnfjsdbfljsbdjfbjsdbfdsbfsbdhfbsdbfhbdshjbfldhjsbfjhbdjhsbfhbdshfbhdsbhjfb</p>','[\"https:\\/\\/res.cloudinary.com\\/dsueaitln\\/image\\/upload\\/v1734033291\\/media\\/fq5r5ectwnjtcuw21man.jpg\"]',115,'active','2024-12-12 19:54:51','2024-12-12 19:54:51'),
